package resources

import (
	"os"
	"strings"

	"fybrik.io/fybrik/manager/apis/app/v1alpha1"
)

var nodeImages = map[string]string{
	"asset":                        "data:image/svg+xml;base64,",
	"workload":                     "data:image/svg+xml;base64,",
	"read":                         "data:image/svg+xml;base64,",
	"copy":                         "data:image/svg+xml;base64,",
	"read-and-transform":           "data:image/svg+xml;base64,",
	"transform-conf":               "data:image/svg+xml;base64,",
	"arrow-flight-module":          "data:image/svg+xml;base64,",
	"arrow-read-with-transform":    "data:image/svg+xml;base64,",
	"arrow-read-without-transform": "data:image/svg+xml;base64,",
	"read-template":                "data:image/svg+xml;base64,",
	"transform-template":           "data:image/svg+xml;base64,",
}

func (plotter Plotter) ConvertToGraph() *Graph {
	plotter = plotter.CreateClusterColorMap()
	graph := Graph{Nodes: make(map[string]*Node), Supernodes: make(map[string]*Node)}
	for cluster, color := range plotter.ClusterColors {
		graph.CreateComment("Cluster: "+cluster, color)
	}

	workload := plotter.AddWorkload(graph)
	for id := range plotter.Spec.Assets {
		plotter.AddAssest(graph, id)
	}

	for _, flow := range plotter.Spec.Flows {
		for _, subflow := range flow.SubFlows {
			var templates []*Node
			var triggers []string
			src := subflow.Steps[0][0].Parameters.Source.AssetID
			for _, step := range subflow.Steps {
				template := plotter.AddTemplate(graph, step[0].Template, step[0].Cluster)
				//template.Triggers = triggers
				dest := step[0].Parameters.Sink
				if dest != nil {
					dest := dest.AssetID
					graph.ConnectNodes(template, graph.Nodes[dest], "")
				}
				templates = append(templates, template)
			}

			graph.ConnectNodes(graph.Nodes[src], templates[0], "")
			if len(templates) > 1 {
				for i := 0; i < len(templates)-1; i++ {
					graph.ConnectNodes(templates[i], templates[i+1], "")
				}
			}

			for _, trigger := range subflow.Triggers {
				if trigger == "workload" {
					graph.ConnectNodes(templates[len(templates)-1], workload, "")
				} else {
					triggers = append(triggers, string(trigger))
				}
			}
			for _, t := range templates {
				t.Triggers = triggers
			}
		}
	}
	return &graph
}

func (plotter Plotter) CreateClusterColorMap() Plotter {
	var colors = []string{"blue", "green", "orange", "yellow", "purple"}
	colorIndex := 0
	plotter.ClusterColors = make(map[string]string)
	for cluster := range plotter.Status.Blueprints {
		plotter.ClusterColors[cluster] = colors[colorIndex]
		colorIndex++
		if colorIndex >= len(colors) {
			os.Exit(1)
		}
	}
	return plotter
}

func (plotter Plotter) AddTemplate(graph Graph, templateId string, cluster string) *Node {
	_, tExists := plotter.Spec.Templates[templateId]
	_, cExists := plotter.Status.Blueprints[cluster]
	if !tExists || !cExists {
		os.Exit(1)
	}
	template, nodeExists := graph.Supernodes[templateId+"-template-"+cluster]
	if nodeExists {
		return template
	}
	template = graph.CreateSupernode(templateId + "-template-" + cluster)
	template.Title = templateId
	template.Color = plotter.ClusterColors[cluster]
	template.Image = nodeImages[template.Title]
	for _, module := range plotter.Spec.Templates[templateId].Modules {
		node := plotter.AddModule(graph, module.Name, cluster)
		node.SupernodeParentId = template.Id
	}
	return template
}

func (plotter Plotter) AddModule(graph Graph, moduleName string, cluster string) *Node {
	node := graph.CreateNode(moduleName + "-module-" + cluster)
	node.Title = moduleName
	node.Color = plotter.ClusterColors[cluster]
	node.Image = nodeImages[node.Title]
	status, statusExist := plotter.Status.Blueprints[cluster].Status.ModulesState[moduleName]
	//pprint(plotter.Status.Blueprints[cluster].Status)
	if statusExist {
		node.AddStatus(status)
	}
	return node
}

func (plotter Plotter) AddAssest(graph Graph, assetId string) *Node {
	node := graph.CreateNode(assetId)
	node.Title = assetId[strings.IndexRune(assetId, '/')+1:]
	status, statusExist := plotter.Status.Assets[assetId]
	if statusExist {
		node.AddStatus(status)
	}
	node.Image = nodeImages["asset"]
	return node
}

func (node *Node) AddStatus(status v1alpha1.ObservedState) {
	if !status.Ready {
		node.Status = "warning"
		node.Description += "\nResource not ready;"
	}
	if status.Error != "" {
		node.Status = "error"
		node.Description += "\nError: " + status.Error + ";"
	}
}

func (plotter Plotter) AddWorkload(graph Graph) *Node {
	workload := graph.CreateNode(plotter.Spec.Selector.WorkloadSelector.MatchLabels["app"])
	workload.Image = nodeImages["workload"]
	color, exists := plotter.ClusterColors[plotter.Spec.Selector.ClusterName]
	if !exists {
		workload.Color = "default"
	} else {
		workload.Color = color
	}
	return workload
}
